import { StyleSheet } from 'react-native'

const styles = StyleSheet.create({
  buttonText: {color: 'white', textAlign: 'center'},
  button: {margin: 10, backgroundColor: 'black', padding: 15, borderRadius: 5 },
  bold: { fontWeight: 'bold' },
  textInput: {margin: 20, borderWidth: 1, borderColor: 'black', borderRadius: 5, padding: 5, textAlign: 'center'},
  pad: { padding: 20 }
})

export default styles
